(1, 'Chairs', '<p style=\"text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-size: 13.93px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; margin-top: 0px; margin-bottom: 1rem; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; -webkit-text-stroke-width: 0px;\"><font color=\"#636363\" size=\"4\" style=\"background-color: inherit;\"><span style=\'font-family: \"Verdana\";\'>A range of chairs for the kitchen and living room includes lounge chairs and computer chairs</span></font><span style=\'font-family: \"Verdana\"; font-size: 18px;\'><font style=\"box-sizing: border-box;\"><span style=\'font-family: \"Verdana\"; font-size: 18px; box-sizing: border-box;\'><br></span></font></span></p><p><font color=\"#636363\"></font><font style=\"background-color: inherit;\"></font><br></p>', 'chairs', '02.01.2020.19.11.28-chairs.jpeg', '2020-01-12 15:46:22', '2019-11-27 00:00:00'),
(2, 'Beds', '<p style=\"text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-size: 13.93px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; margin-top: 0px; margin-bottom: 1rem; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; -webkit-text-stroke-width: 0px;\"><span style=\'font-family: \"Verdana\"; font-size: 18px;\'><font color=\"#636363\" style=\"background-color: inherit;\">A variety of double and single bedroom beds from wood and metal</font></span><span style=\'font-family: \"Verdana\"; font-size: 18px;\'><font color=\"#636363\" style=\"background-color: inherit;\"><br></font></span></p><p style=\"text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-size: 13.93px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; margin-top: 0px; margin-bottom: 1rem; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; -webkit-text-stroke-width: 0px;\"><span style=\'font-family: \"Verdana\"; font-size: 18px;\'><font color=\"#636363\" style=\"background-color: inherit;\"><br></font></span></p><p style=\"text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-size: 13.93px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; margin-top: 0px; margin-bottom: 1rem; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; -webkit-text-stroke-width: 0px;\"><br></p><p><font color=\"#000000\" size=\"4\"><span style=\'font-family: \"Verdana\"; font-size: 18px;\'></span></font></p>', 'beds', '02.01.2020.19.11.38-beds.jpeg', '2020-01-12 12:30:34', '2019-11-29 00:00:00'),
(3, 'Sofas', '<span style=\'text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"Verdana\"; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; display: inline !important; white-space: pre-wrap; orphans: 2; float: none; -webkit-text-stroke-width: 0px;\'><font color=\"#636363\" style=\"background-color: inherit;\">Two-seater sofas and seating systems in a variety of colors and materials such as: leather and fabric</font></span><br>', 'sofas', '08.01.2020.12.44.03-sofa4.jpeg', '2020-01-12 10:17:40', '2019-11-29 00:00:00'),
(4, 'Cupboards', '<p><font color=\"#636363\"><font style=\"background-color: inherit;\"><span title=\"\" style=\'text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"Verdana\"; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; white-space: pre-wrap; orphans: 2; -webkit-text-stroke-width: 0px;\'>Wardrobes of all sizes - 2,3 and 4 doors.</span><span style=\'font: 400 18px/32px \"Verdana\"; text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; text-decoration: none; word-spacing: 0px; display: inline !important; white-space: pre-wrap; orphans: 2; float: none; -webkit-text-stroke-width: 0px;\'> </span><span title=\"\" style=\'text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"Verdana\"; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; white-space: pre-wrap; orphans: 2; -webkit-text-stroke-width: 0px;\'>Available in a variety of colors to choose from.</span><span style=\'font: 400 18px/32px \"Verdana\"; text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; text-decoration: none; word-spacing: 0px; display: inline !important; white-space: pre-wrap; orphans: 2; float: none; -webkit-text-stroke-width: 0px;\'> </span><span title=\"\" style=\'text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"Verdana\"; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; white-space: pre-wrap; orphans: 2; -webkit-text-stroke-width: 0px;\'>A cupboard can be ordered to any size</span></font></font><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p>', 'cupboards', '02.01.2020.19.12.05-cupboard.jpeg', '2020-01-12 12:08:25', '2019-12-30 17:53:01'),
(5, 'Armchairs', '<p><font color=\"#636363\" face=\'\"Verdana\"\' size=\"4\" style=\"background-color: inherit;\">We have some very comfortable leather armchairs that open at the touch of a button</font><font color=\"#636363\" face=\'\"Verdana\"\' size=\"4\" style=\"background-color: inherit;\"><br></font></p><p><font color=\"#636363\" face=\'\"Verdana\"\' size=\"4\" style=\"background-color: inherit;\"><br></font></p><p></p>', 'armchairs', '08.01.2020.10.44.13-armchair1.jpeg', '2020-01-12 15:24:41', '2019-12-31 10:43:24'),
(6, 'Tables', '<p><span style=\'text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"Verdana\"; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; display: inline !important; white-space: pre-wrap; orphans: 2; float: none; -webkit-text-stroke-width: 0px;\'><font color=\"#636363\" style=\"background-color: inherit;\">A variety of living room and kitchen tables combined with wood and metal option to add matching chairs to each table</font></span><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p>', 'tables', '02.01.2020.19.12.23-tables.jpeg', '2020-01-12 15:38:02', '2019-12-31 10:43:53'),
(7, 'Dressings', '<p><span style=\'text-align: left; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"Verdana\"; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; display: inline !important; white-space: pre-wrap; orphans: 2; float: none; -webkit-text-stroke-width: 0px;\'><font color=\"#636363\" style=\"background-color: inherit;\">Quality solid wood cabinets and also melamine in a variety of customizable colors and sizes</font></span><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p>', 'dressings', '02.01.2020.19.12.34-dresser.jpeg', '2020-01-12 16:00:48', '2019-12-31 10:51:11');

