(1, 1, 'About  Pavel Furniture', '<p><span title=\"\" style=\"color: rgba(0, 0, 0, 0.87); font-family: &amp;quot;Roboto&amp;quot;,arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\">This site is part of a portfolio I create in a web development course.</span><span style=\'display: inline !important; float: none; background-color: rgb(245, 245, 245); color: rgba(0, 0, 0, 0.87); font-family: \"Roboto\",arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; line-height: 28px; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\'> </span><span title=\"\" style=\"color: rgba(0, 0, 0, 0.87); font-family: &amp;quot;Roboto&amp;quot;,arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\">The goal of the site is to simulate a real sales site with products and a shopping cart.</span><span style=\'display: inline !important; float: none; background-color: rgb(245, 245, 245); color: rgba(0, 0, 0, 0.87); font-family: \"Roboto\",arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; line-height: 28px; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\'> </span><span title=\"\" style=\"color: rgba(0, 0, 0, 0.87); font-family: &amp;quot;Roboto&amp;quot;,arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\">The site deals with selling furniture such as tables, chairs and cabinets.</span><span style=\'display: inline !important; float: none; background-color: rgb(245, 245, 245); color: rgba(0, 0, 0, 0.87); font-family: \"Roboto\",arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; line-height: 28px; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\'> </span><span title=\"\" style=\"color: rgba(0, 0, 0, 0.87); font-family: &amp;quot;Roboto&amp;quot;,arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\">In the future it will be possible to develop the site and add more options and really use it.</span></p><p><img style=\"width: 789.2px;\" src=\"data:image/jpeg;base64,\" data-filename=\"me.jpg\"><span title=\"\" style=\"color: rgba(0, 0, 0, 0.87); font-family: &amp;quot;Roboto&amp;quot;,arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\"><br></span></p><p><span style=\"font-size: 24px;\">﻿Pavel Lutcenko - The founder</span><span title=\"\" style=\"color: rgba(0, 0, 0, 0.87); font-family: &amp;quot;Roboto&amp;quot;,arial,sans-serif; font-size: 18px; font-style: nor