-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\">Delivery is up to 21 working days excluding Saturdays and holidays.</span><span style=\'display: inline !important; float: none; background-color: rgb(245, 245, 245); color: rgba(0, 0, 0, 0.87); font-family: \"Roboto\",arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; line-height: 28px; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\'> </span><span title=\"\" style=\"color: rgba(0, 0, 0, 0.87); font-family: &amp;quot;Roboto&amp;quot;,arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\">We only supply the best quality European furniture.</span><span style=\'display: inline !important; float: none; background-color: rgb(245, 245, 245); color: rgba(0, 0, 0, 0.87); font-family: \"Roboto\",arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; line-height: 28px; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: pre-wrap; word-spacing: 0px;\'> </span><span title=\"\" style=\"color: rgba(0, 0, 0, 0.87); font-family: &amp;quot;Roboto&amp;quot;,arial,sans-serif; font-size: 18px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-